INSERT INTO `hustles` VALUES ('9dc5ebeb-1a2f-4b71-a823-2a45dae6071f','Generic Web Development Project','Need a professional in Web Development for a project.','9dc5c350-16be-45e1-8a4b-1cd8c482a1f8',200000.00,'2025-01-14','- Expertise in Web Development\n- Professional experience\n- Good communication skills','completed','9dc5fe82-c87d-44dc-8912-fe130ae11331',0,0,'2024-12-20 21:32:01','2024-12-20 21:32:01'),('9dc5ebec-ce57-4228-97d2-f015d06561ca','Generic Mobile Development Project','Need a professional in Mobile Development for a project.','9dc5c350-d331-4044-b1e0-55fa7b601d07',286772.00,'2025-01-10','- Expertise in Mobile Development\n- Professional experience\n- Good communication skills','approved','9dcdcba2-a835-4be1-b523-92a8e71eb7f0',0,0,'2024-12-20 21:32:02','2024-12-20 21:32:02'),('9dc5ebed-498d-4a85-ac57-0c730c863d09','Mobile App Redesign','Redesign our existing mobile app interface to improve user experience and modernize the look and feel.','9dc5c351-1387-4933-b16d-ff48dbd0536f',200000.00,'2024-12-31','- Mobile UI/UX expertise\n- Figma proficiency\n- User research experience\n- Prototyping skills','open',NULL,0,0,'2024-12-20 21:32:03','2024-12-20 21:32:03'),('9dc5ebed-c0fa-4722-99a4-fb3fbd1c5a66','Design System Creation','Create a comprehensive design system for our product suite, including components, guidelines, and documentation.','9dc5c351-1387-4933-b16d-ff48dbd0536f',450000.00,'2025-01-11','- Design system experience\n- Component library creation\n- Documentation writing\n- Team collaboration','open',NULL,0,0,'2024-12-20 21:32:03','2024-12-20 21:32:03'),('9dc5ebee-2f18-4a5f-b764-ade3ab8857ad','Generic Cyber Security Project','Need a professional in Cyber Security for a project.','9dc5c351-46c2-4208-b351-06c872b8b509',222756.00,'2025-01-07','- Expertise in Cyber Security\n- Professional experience\n- Good communication skills','open',NULL,0,0,'2024-12-20 21:32:03','2024-12-20 21:32:03'),('9dc5ebee-bf70-49aa-aa8a-b48987ada719','Customer Data Analysis','Analyze our customer data to identify patterns and provide actionable insights for improving customer retention and satisfaction.','9dc5c351-54a9-4bf6-b798-d771bde71ff7',400000.00,'2024-12-29','- Python/R proficiency\r\n- Data visualization skills\r\n- Statistical analysis experience','open',NULL,0,0,'2024-12-20 21:32:04','2024-12-27 10:33:04'),('9dc5ebef-1e8a-4a62-a8a9-dff7b9996a24','Predictive Model Development','Develop a predictive model for forecasting sales based on historical data and market indicators.','9dc5c351-54a9-4bf6-b798-d771bde71ff7',350000.00,'2024-12-29','- Machine learning expertise\n- Time series analysis\n- Model deployment experience\n- Data preprocessing skills','open',NULL,0,0,'2024-12-20 21:32:04','2024-12-20 21:32:04'),('9dc5ebef-622f-4018-89fa-a044ed5bb283','Generic DevOps Project','Need a professional in DevOps for a project.','9dc5c351-611a-439a-b018-2f1ad42b5bf1',208960.00,'2025-01-14','- Expertise in DevOps\n- Professional experience\n- Good communication skills','open',NULL,0,0,'2024-12-20 21:32:04','2024-12-20 21:32:04'),('9dc5ebef-9c23-4d76-8066-70c7fac727db','Generic Cloud Computing Project','Need a professional in Cloud Computing for a project.','9dc5c351-7b8f-4eeb-8b4f-e2dfaea5759c',304356.00,'2025-01-12','- Expertise in Cloud Computing\n- Professional experience\n- Good communication skills','open',NULL,0,0,'2024-12-20 21:32:04','2024-12-20 21:32:04'),('9dc5ebef-c004-470c-a602-fa4d01a9d787','Generic Project Management Project','Need a professional in Project Management for a project.','9dc5c351-90f8-4c85-a0dc-d9043341caec',258727.00,'2025-01-02','- Expertise in Project Management\n- Professional experience\n- Good communication skills','open',NULL,0,0,'2024-12-20 21:32:04','2024-12-20 21:32:04'),('9dd33d58-e22d-476c-ba23-0c4891ccfaed','Mobile App Developer Needed for Cross-Border Payment App','We are seeking a skilled mobile app developer to build a cross-border payment application similar to Chipper Cash or ChyperCache. The app will enable users in Africa to send money to recipients in other countries (e.g., the US and Europe). The platform should support secure transactions, direct bank account transfers, and automatic fund transfers.\r\n\r\nKey features include:\r\n\r\nUser registration and verification.\r\nSecure payment gateway integration.\r\nMulti-currency support.\r\nTransaction tracking and notifications.\r\nClean and user-friendly interface (UI/UX).\r\nThe app should be compatible with both iOS and Android platforms.','9dc5c350-d331-4044-b1e0-55fa7b601d07',700000.00,'2025-01-31','Proven experience in mobile app development (iOS and Android).\r\nStrong knowledge of payment gateway APIs (e.g., Flutterwave, Paystack, or equivalent).\r\nProficiency in frameworks like React Native or Flutter.\r\nPortfolio showcasing previous fintech or similar projects.\r\nAbility to deliver a secure and scalable solution within the timeline.','in_progress','9dcdcba2-a835-4be1-b523-92a8e71eb7f0',1,0,'2024-12-27 12:25:28','2024-12-27 15:54:56');
